import React from 'react';
import { useEffect, useState } from "react";

const AllBooks = () => {
  const [data, setData] = useState('');

  useEffect(()=>{
    async function Res(){
        const result = await fetch('http://localhost:5555/books')
        const res = await result.json()
        setData(res.count)
    }

    Res();
  })
  return (
    <div className='allbooks'>
      <table>
        <tr>
          <th>Book Name</th>
          <th>Auther Name</th>
          <th>Total Copies</th>
          <th>Available Copies</th>
        </tr>
        <tr>
          <td>My Rule My Life</td>
          <td>Kunal </td>
        </tr>
      </table>
    </div>
  )
}

export default AllBooks
